import React from 'react';
import './App.css';
import SimpleCard from './Card';
import { Grid } from '@material-ui/core';

function App() {
  return (
    <Grid container spacing={3} className="App">
      <Grid item xs={0} sm={1} />
      <Grid item>
        <SimpleCard />
      </Grid>
      <Grid item>
        <SimpleCard />
      </Grid>
      <Grid item>
        <SimpleCard />
      </Grid>
      <Grid item>
        <SimpleCard />
      </Grid>
      <Grid item>
        <SimpleCard />
      </Grid>
      <Grid item xs={0} sm={1} />
    </Grid>
  );
}

export default App;
